import React, { Component } from 'react';
import {
  Container, Col, Form,
  FormGroup, Label, Input,
  Button,
} from 'reactstrap';

class Appointment extends Component {
  render() {
    return (
      <Container className="App">
        <p class="text-danger">BOOK APPOINTMENT</p>
        <Form className="form"  action="/body" method="post">
          <Col>
            <FormGroup>
              <Label>Name:</Label>
              <Input type="text" name="username" id="name" placeholder="enter your name" />
            </FormGroup>
          </Col>

          <Col>
            <FormGroup>
              <Label>Password:</Label>
              <Input type="Password" name="password" id="age" placeholder="enter your age" />
            </FormGroup>
          </Col>

          <Button>Submit</Button>
        </Form>
      </Container>
    );
  }
}

export default Appointment;
